import React, { useState, useEffect } from 'react';
import {
  Container,
  Typography,
  Button,
  Select,
  MenuItem,
  FormControl,
  InputLabel,
  Box,
  RadioGroup,
  FormControlLabel,
  Radio,
  AppBar,
  Toolbar,
  CssBaseline,
  Dialog, 
  DialogContent, 
  DialogActions 
} from '@mui/material';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import { gapi } from 'gapi-script';

// Import logo image (add your logo image in the public folder)
const logoUrl = 'data:image/png;base64,'

const App = () => {
  const [name, setName] = useState('');
  const [status, setStatus] = useState('Sign In');
  const [openDialog, setOpenDialog] = useState(false);  // Control the dialog state
  const [greeting, setGreeting] = useState('');

  const CLIENT_ID = process.env.REACT_APP_GOOGLE_CLIENT_ID;
  const API_KEY = process.env.REACT_APP_GOOGLE_API_KEY;
  const SPREADSHEET_ID = process.env.REACT_APP_SPREADSHEET_ID;
  const RANGE = 'Sheet1!A2'; // Change this based on the range you want to write to in your Google Sheet

  // Initialize Google API when the component mounts
  useEffect(() => {
    const initClient = () => {
      gapi.client.init({
        apiKey: API_KEY,
        clientId: CLIENT_ID,
        scope: 'https://www.googleapis.com/auth/spreadsheets',
        discoveryDocs: ["https://sheets.googleapis.com/$discovery/rest?version=v4"],
      }).then(() => {
        gapi.auth2.getAuthInstance().signIn();
      });
    };

    gapi.load('client:auth2', initClient);
    setGreeting(getGreeting()); // Set the greeting on component mount
    // Change the document title
    document.title = "Office Attendance";
  }, [API_KEY, CLIENT_ID]);

  const getGreeting = () => {
    const hour = new Date().getHours();
    if (hour < 12) return 'Good Morning';
    if (hour < 18) return 'Good Afternoon';
    return 'Good Evening';
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    // Prepare data to send to Google Sheets
    const values = [
      [name, status, new Date().toLocaleString('en-GB')], // Add name, status, and current timestamp
    ];

    const body = {
      values: values,
    };

    // Append data to the Google Sheet
    try {
      const response = await gapi.client.sheets.spreadsheets.values.append({
        spreadsheetId: SPREADSHEET_ID,
        range: RANGE,
        valueInputOption: 'RAW',
        resource: body,
      });
      console.log(`${response.result.updates.updatedCells} cells updated.`);
      if (response.status === 200) {
        // Open confirmation dialog on successful update
        setOpenDialog(true);
      }
    } catch (error) {
      console.error("Error updating Google Sheet:", error);
      window.alert('Failed to update attendance. Please try again.');
    }

    // Clear form fields after submission
    setName('');
    setStatus('Sign In');
  };


  const handleCloseDialog = () => {
    setOpenDialog(false);
  };

  // Theme customization (light mode only)
  const theme = createTheme({
    palette: {
      primary: {
        main: '#1976d2',
      },
      background: {
        default: '#f5f5f5',
        paper: '#ffffff',
      },
    },
  });

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <AppBar position="static" elevation={0} style={{ backgroundColor: 'transparent' }}>
        <Toolbar>
          {/* Logo at the top left */}
          <Box sx={{ display: 'flex', alignItems: 'center', flexGrow: 1 }}>
            <img src={logoUrl} alt="Logo" style={{ width: '200px', height: 'auto', marginRight: '1rem' }} />
            <Typography variant="h6" component="div" sx={{ textAlign: 'center', flexGrow: 1 }}>
              Office Attendance
            </Typography>
          </Box>
        </Toolbar>
      </AppBar>

      <Container maxWidth="sm" style={{ marginTop: '2rem' }}>
        <Box
          sx={{
            padding: '2rem',
            backgroundColor: 'background.paper',
            borderRadius: '10px',
            boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
          }}
        >
          {/* Logo moved to the AppBar */}

          <Typography variant="h4" gutterBottom align="center" sx={{ paddingBottom: '40px' }}>
            Office Attendance
          </Typography>

          <Typography variant="h8" gutterBottom align="center" >
            {greeting}! {/* Display the greeting here */}
          </Typography>

          <form onSubmit={handleSubmit}>
            {/* Name Dropdown */}
            <FormControl fullWidth margin="normal">
              <InputLabel>Name</InputLabel>
              <Select
                value={name}
                label="Name"
                onChange={(e) => setName(e.target.value)}
                required
              >
                <MenuItem value="Pooja">Pooja</MenuItem>
                <MenuItem value="Rahul">Rahul</MenuItem>
                <MenuItem value="Shailendra">Shailendra</MenuItem>
                <MenuItem value="Shantaram">Shantaram</MenuItem>
              </Select>
            </FormControl>

            {/* Radio Button for Sign In / Sign Out */}
            <FormControl component="fieldset" fullWidth margin="normal">
              <Typography component="legend">Status</Typography>
              <RadioGroup
                row
                value={status}
                onChange={(e) => setStatus(e.target.value)}
              >
                <FormControlLabel
                  value="Sign In"
                  control={<Radio color="primary" />}
                  label="Sign In"
                />
                <FormControlLabel
                  value="Sign Out"
                  control={<Radio color="primary" />}
                  label="Sign Out"
                />
              </RadioGroup>
            </FormControl>

            {/* Submit Button */}
            <Box textAlign="center" mt={3}>
              <Button
                type="submit"
                variant="contained"
                color="primary"
                size="large"
              >
                Submit Attendance
              </Button>
            </Box>
          </form>
          {/* Confirmation Dialog */}
          <Dialog open={openDialog} onClose={handleCloseDialog}>
            {/* <DialogTitle>Confirmation</DialogTitle> */}
            <DialogContent>Attendance recorded successfully!</DialogContent>
            <DialogActions>
              <Button onClick={handleCloseDialog} color="primary">
                OK
              </Button>
            </DialogActions>
          </Dialog>
        </Box>
      </Container>
    </ThemeProvider>
  );
};

export default App;
